@import url("https://fonts.googleapis.com/css2?family=Poppins:wght@200;300;400;500;600;700;800;900&display=swap");
.cards {
  display: flex;
  align-items: center;
  justify-content: space-around;
  flex-wrap: wrap;
  gap: 8rem 3rem;
  width: 75%;
}
.cards .arkan {
  background-color: white;
  height: 340px;
  border-radius: 1px;
  width: 300px;
  text-align: center;
  padding: 25px;
  border: none;
  position: relative;
  background-image: url("data:image/svg+xml,%3csvg width='100%25' height='100%25' xmlns='http://www.w3.org/2000/svg'%3e%3crect width='100%25' height='100%25' fill='none' stroke='%23E3E7EBFF' stroke-width='3' stroke-dasharray='6' stroke-dashoffset='5' stroke-linecap='square'/%3e%3c/svg%3e");
  box-shadow: 0 0 0 1rem rgb(255, 255, 255), 0 0 10px 1rem rgb(166, 166, 166);
}
.cards .arkan:not(.modified *)::before {
  box-shadow: 0 0 10px 5px rgb(80, 80, 80);
}
.cards .arkan .barco {
  aspect-ratio: 1/1;
  object-fit: cover;
  width: 7.6rem;
  border-radius: 50%;
  position: absolute;
  top: -1rem;
  transform: translate(-50%, -50%);
  box-shadow: 0 0 10px 1px rgb(170, 170, 170);
  filter: grayscale(60%);
  z-index: 3;
  transition: 350ms;
}
.cards .arkan .barco.active {
  filter: brightness(50%);
}
.cards .arkan .title {
  font-size: 1.6rem;
  font-weight: 500;
  font-family: "Poppins";
  margin-top: 1.8rem;
  color: #515058;
}
.cards .arkan .subtitle {
  font-size: 0.86rem;
  font-weight: 600;
  font-family: "Poppins";
  color: #9a99a5;
}
.cards .arkan .sosmed {
  margin-top: 0.78rem;
  display: flex;
  align-items: center;
  justify-content: center;
  gap: 1rem;
}
.cards .arkan .sosmed > .btn {
  aspect-ratio: 1/1;
  width: 100%;
  padding: 1.1rem;
  transform: scale(0.87);
  font-size: 1.7rem;
  background-color: #e7eaef;
  opacity: 0.7;
  border-radius: 50%;
  border: none;
  transition: 150ms;
}
.cards .arkan .sosmed > .btn:hover {
  opacity: 1;
  background-color: #e7eaef;
}
.cards .arkan .sosmed > .btn .fa-brands {
  color: #535252;
}
.cards .arkan .footer {
  background-color: #424242;
  color: white;
  font-size: 1.2rem;
  min-height: 80px;
  position: absolute;
  inset: auto -1rem -1rem -1rem;
  border-radius: 0 0 15px 15px;
  display: grid;
  font-weight: bold;
  place-items: center;
  z-index: 997;
}
.cards .arkan .footer .badges {
  background-color: #7d7d7d;
  padding-block: 0.3rem;
  padding-inline: 1rem;
  font-size: 1rem;
  font-weight: 500;
  border-radius: 10px;
  position: absolute;
  transform: translateY(-50%);
  top: 0;
}
.cards .arkan .desc {
  background-color: white;
  position: absolute;
  z-index: 998;
  padding: 1.8rem;
  inset: 0;
  border-radius: 15px;
  box-shadow: 0 0 0 10px 2px #ccc;
  opacity: 0;
  transform: scale(0);
  visibility: hidden;
  transition: 350ms ease-in-out;
}
.cards .arkan .desc.active {
  opacity: 1;
  text-align: justify;
  visibility: visible;
  transform: scale(1);
}
.cards .arkan .desc .close-btn {
  position: absolute;
  top: 20px;
  right: 20px;
}
.cards .arkan .backdrop.card {
  position: absolute;
  inset: -1rem;
  border-radius: 15px;
  z-index: 10;
  background-color: rgba(0, 0, 0, 0.9);
}
.cards .arkan .btn {
  background-color: #4a4a4a;
  padding-block: 0.3rem;
  padding-inline: 1rem;
  font-size: 1rem;
  font-weight: 500;
  border-radius: 10px;
  color: white;
  border: none;
  margin-top: 5px;
  transition: 150ms;
}
.cards .arkan .btn:hover {
  background-color: #2c2c2c;
}
.cards .modified {
  background: linear-gradient(to top right, #2c2c2c 24%, white 24%, white 76%, #515058 76%, #515058);
  box-shadow: 0 0 7px 1px rgb(170, 170, 170);
  padding: 2rem;
  width: fit-content;
  border-radius: 15px;
}
.cards .modified .arkan {
  background-image: none;
  height: 350px;
  border-radius: 15px;
}
@media (max-width: 600px) {
  .cards .modified .arkan {
    width: 290px;
  }
}
.cards .modified .arkan .backdrop.card {
  inset: -2rem;
}
.cards .modified .arkan > .subtitle2 {
  font-size: 1rem;
  font-weight: 600;
  color: #2c2c2c;
  margin-top: 1rem;
  font-weight: bold;
  text-transform: uppercase;
}
.cards .modified .btn {
  margin-top: 1rem;
}

@media (max-width: 1050px) {
  :root {
    font-size: 14px !important;
  }
}
@media (max-width: 930px) {
  .footer-brand {
    display: none !important;
  }

  .footerflex {
    justify-content: center !important;
  }
}
@media (max-width: 1250px) {
  .footer-brand {
    max-width: 30rem !important;
  }
}
@media (max-width: 500px) {
  :root {
    font-size: 13px !important;
  }
}
@media (max-width: 400px) {
  :root {
    font-size: 11px !important;
  }

  .modif {
    padding-bottom: 0 !important;
    padding-top: 0 !important;
    box-sizing: content-box;
  }

  .kartunama {
    padding-bottom: 20rem;
  }

  .sosmed > .btn {
    font-size: 2.3rem !important;
  }

  .btn {
    font-size: 1.4rem;
  }

  .modified .arkan {
    height: 300px;
  }
}
@media (max-width: 570px) {
  .hide-on-below-570 {
    display: none !important;
  }

  .remove-edge-on-small::after {
    display: none !important;
  }

  .modif {
    padding-bottom: 5rem;
    padding-top: 5rem;
    box-sizing: content-box;
  }
}
.footerflex {
  display: flex;
  justify-content: space-between;
  align-items: center;
}
.footerflex .footer-brand {
  font-weight: bold;
  font-size: 1.9rem;
  color: white;
  display: flex;
  flex-direction: column;
  max-width: 40rem;
}
.footerflex .footer-brand .subtitle {
  font-weight: 200;
  font-family: "Poppins";
  font-size: 1.1rem;
  text-align: left;
  margin-top: 1rem;
}
.footerflex .links {
  display: flex;
  column-gap: 1.5rem;
}
.footerflex .links .link {
  color: white;
  font-size: 1.6rem;
  padding-right: 3rem;
  border-right: 1px solid #fff;
}
.footerflex .links .link:last-child {
  padding-right: 0;
  border-right: none;
}
.footerflex .links .link .link-header {
  font-weight: bold;
  text-transform: uppercase;
  font-size: 1em;
  text-align: left;
}
.footerflex .links .link li {
  font-weight: 400;
  font-size: 0.7em;
  text-align: left;
  font-family: "Poppins";
  font-weight: 300;
  cursor: pointer;
}
.footerflex .links .link li:hover {
  text-decoration: underline;
  color: rgb(123, 123, 126);
}

.copyright {
  display: flex;
  justify-content: space-between;
  color: white;
}
.copyright ul li {
  display: inline-block;
  margin-left: 1rem;
}
.copyright ul li:hover {
  text-decoration: underline;
  color: rgb(123, 123, 126);
}

.menu-list {
  list-style: none;
  position: absolute;
  width: 11rem;
  transform: scale(0);
  background-color: #fff;
  border: 1px solid #ccc;
  border-radius: 10px;
  overflow: hidden;
  transition: 200ms ease-in-out;
  transform-origin: top left;
  z-index: 9999;
  margin-top: 2rem;
}
.menu-list.right {
  transform-origin: top right !important;
  right: 0;
}
.menu-list.active {
  transform: scale(1);
}
.menu-list li {
  margin-inline: 0 !important;
  border-bottom: 1px solid #ccc;
  padding-inline: 1rem;
  padding-block: 0.7rem !important;
  font-weight: 500 !important;
  width: 100%;
  transition: 350ms;
}
.menu-list li:last-child {
  border: none;
}
.menu-list li:hover {
  background-color: rgba(86, 86, 86, 0.7);
}
.menu-list li:hover a {
  color: white;
}
.menu-list li.active {
  background-color: #333333;
}
.menu-list li.active a {
  color: white;
  font-weight: bold !important;
}

span.ripple {
  width: 1rem;
  aspect-ratio: 1/1;
  transform: scale(0);
  border-radius: 50%;
  position: absolute;
  animation: large 600ms linear;
  background-color: var(--color);
  opacity: 0.7;
}

@keyframes large {
  to {
    transform: scale(var(--size));
    opacity: 0;
  }
}
.d-none-large {
  display: var(--display, none) !important;
}
@media (max-width: 960px) {
  .d-none-large {
    --display:inline-block ;
  }
}

.backdrop {
  position: fixed;
  inset: 0;
  background: rgba(0, 0, 0, 0.6);
  transition: 350ms;
  visibility: hidden;
  z-index: 9997;
  opacity: 0;
}
.backdrop.active {
  opacity: 0.5;
  visibility: visible;
}

.navbar {
  display: flex;
  align-items: center;
  justify-content: space-between;
  padding: 1rem 3rem !important;
  background-color: white;
  position: fixed;
  inset: 0 0 auto 0;
}
@media (min-width: 620px) {
  .navbar {
    padding: 1rem 2rem;
  }
}
.navbar.border-1 {
  box-shadow: 0 2px 10px 1px #cccccc;
  z-index: 9999;
}
.navbar .navbar-brand {
  font-weight: bold;
  font-size: 1.9rem;
  color: black;
  display: flex;
}
@media (min-width: 460px) {
  .navbar .navbar-brand {
    margin-left: 1rem;
  }
}
.navbar .navbar-brand.active {
  display: none;
}
@media (max-width: 980px) {
  .navbar .links {
    display: none;
  }
}
.navbar .links * {
  float: left;
}
.navbar .links li {
  list-style: none;
  font-weight: bold;
  font-family: "Poppins";
  position: relative;
  margin-inline: 1rem;
  padding-block-end: 0.2rem;
  cursor: pointer;
}
.navbar .links li:hover::before, .navbar .links li.active::before {
  max-width: 100%;
}
.navbar .links li::before {
  content: "";
  position: absolute;
  max-width: 0;
  inset: 90% 0 0 0;
  background-color: #f14d4d;
  transition: 450ms;
}
.navbar .links li a {
  font-size: 1.2rem;
}
.navbar .search-bar {
  font-family: TTCommons;
  border-radius: 10px;
  border: 1px solid #ccc;
  font-weight: bold;
  font-size: 16px;
  padding: 0.8rem;
  max-width: 200px;
  padding-left: 3rem;
}
@media (max-width: 650px) {
  .navbar .search-bar {
    display: none;
  }
}
.navbar .search-icon {
  position: absolute;
  left: 1.3rem;
  top: 0.8rem;
  color: #e9e9e9;
  font-size: 1.2rem !important;
}
@media (max-width: 650px) {
  .navbar .search-icon {
    display: none;
  }
}
.navbar .right-nav {
  display: flex;
  align-items: center;
  column-gap: 1rem;
}
@media (min-width: 460px) {
  .navbar .right-nav {
    margin-right: 1rem;
  }
}
.navbar .right-nav i {
  font-size: 1.6rem;
  color: #696b6d;
}
.navbar .right-nav .nav-button {
  padding: 0.6rem 1rem;
  font-family: "Poppins";
  font-weight: bold;
  background-color: #565656;
  color: white;
  border: none;
  border-radius: 5px;
}
.navbar .right-nav .nav-button:active {
  background-color: #232323;
}
.navbar .right-nav .nav-button:hover {
  background-color: #3d3d3d;
}
.navbar .right-nav .badge {
  position: absolute;
  background: #1e1f1f;
  color: white;
  aspect-ratio: 1/1;
  width: 13px;
  height: 13px;
  font-size: 11px;
  text-align: center;
  vertical-align: middle;
  border-radius: 50%;
  bottom: -2px;
  right: -5px;
}

.accordion .accordion-head {
  background: white;
  border-bottom: 1px solid #ccc;
  border-top: 1px solid #ccc;
  display: flex;
  align-items: center;
  justify-content: space-between;
  padding: 1.2em 1.6em;
  font-weight: bold;
  font-size: 1.3rem;
  transition: 150ms;
}
.accordion .accordion-head:hover {
  background-color: #76787a;
  color: white;
}
.accordion .accordion-head.active {
  background-color: #565656;
  color: white;
}
.accordion .accordion-head.active i {
  transform: rotate(180deg);
}
.accordion .accordion-body {
  max-height: 0;
  overflow: hidden;
  box-sizing: border-box;
  transition: 150ms ease-in-out;
  padding: 0 1.6em;
}
.accordion .accordion-body.active {
  padding: 1.2em 1.6em;
  max-height: 200px;
}
.accordion .accordion-body .accordion-item {
  width: 100%;
  padding: 1rem 1.5rem;
  font-family: "Poppins";
  font-weight: 600;
  transition: 350ms;
}
.accordion .accordion-body .accordion-item:not(:last-child) {
  border-bottom: 1px solid #ccc;
}
.accordion .accordion-body .accordion-item:hover, .accordion .accordion-body .accordion-item.active {
  background-color: #565656;
  color: white;
}

span.ripple {
  width: 1rem;
  aspect-ratio: 1/1;
  transform: scale(0);
  border-radius: 50%;
  position: absolute;
  animation: large 600ms linear;
  background-color: var(--color);
  opacity: 0.7;
}

@keyframes large {
  to {
    transform: scale(var(--size));
    opacity: 0;
  }
}
.sidebar {
  width: 330px;
  height: 100vh;
  position: fixed;
  top: 10px;
  transition: 500ms ease-in-out;
  margin-top: 4.5rem;
  box-shadow: 3px 0 10px 1px #b3b3b3;
  background-color: white;
  transform: translateX(-100%);
  z-index: 9998;
}
@media (max-height: 862px) {
  .sidebar {
    overflow-y: auto;
    padding-block-end: 10rem;
  }
}
.sidebar.active {
  transform: translateX(0) !important;
}
.sidebar .sidebar-item {
  border-top: 1px solid #ccc;
  padding: 1.7rem 2rem;
}
.sidebar .sidebar-item .box {
  padding: 1rem;
  color: white;
}
.sidebar .sidebar-item .box .text {
  margin-left: 3rem;
  text-align: justify;
  position: relative;
  z-index: 2;
}
.sidebar .sidebar-item .box .title {
  position: relative;
  z-index: 2;
  font-weight: bold;
  font-size: 20px;
}
.sidebar .sidebar-item .box .title .iconbox {
  background-color: #ff8a4a;
  width: fit-content;
  padding: 0.6rem;
  aspect-ratio: 1/1;
  border-radius: 5px;
  font-size: 20px;
  display: inline-block;
  margin-right: 0.6rem;
}
.sidebar .sidebar-item .box.black {
  background-color: #333333;
  position: relative;
}
.sidebar .sidebar-item .box.blue {
  background-color: rgba(43, 213, 235, 0.6588235294);
  position: absolute;
  inset: 0;
  clip-path: circle(35% at 0 85%);
  z-index: 1;
}
.sidebar .sidebar-item .box.orange {
  background-color: #565656;
  position: absolute;
  inset: 0;
  clip-path: circle(30% at 90% 95%);
  z-index: 1;
}
.sidebar .sidebar-item-title {
  margin-bottom: 1rem;
  font-weight: bold;
  font-size: 1.4rem;
}

@font-face {
  font-family: TTCommons;
  src: url(../static/regular.woff);
  font-weight:500;
  font-style: normal;
}

@font-face {
  font-family: TTCommons;
  src: url(../static/semibold.woff);
  font-weight: 600;
  font-style: normal;
}
@font-face {
  font-family: TTCommons;
  src: url(../static/bold.woff);
  font-weight: 700;
  font-style: normal;
}
*,
*:after,
*:before {
  margin: 0;
  padding: 0;
  box-sizing: border-box;
}

*:not(.font-inherit) {
  font-family: TTCommons;
}

@media (max-width: 600px) {
  :root {
    font-size: 12px;
  }
}
a {
  display: contents;
  all: unset;
}

:root {
  scroll-behavior: smooth;
}

::-webkit-scrollbar {
  width: 5px;
  height: 5px;
}

.sidebar {
  box-shadow: 0 2px 10px 0.5px black !important;
}

.navbar.border-1 {
  box-shadow: 0 2px 10px 0.5px black !important;
}

::-webkit-scrollbar-track {
  background: #000000 !important;
  border-radius: 5px;
}

::-webkit-scrollbar-thumb {
  border-radius: 5px;
  background: rgb(205, 203, 203);
}

::-webkit-scrollbar-thumb:hover {
  background: rgb(171, 171, 171);
}

section {
  background-color: var(--color);
  min-height: clamp(300px, 100vh, var(--max-height, 880px));
  display: flex;
  align-items: center;
  justify-content: center;
  position: relative;
  gap: 1rem;
}
section .container {
  width: min(80rem, 90vw);
  text-align: center;
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  position: relative;
  row-gap: 1rem;
}
section .container .nav-button {
  padding: 0.6rem 1rem;
  font-family: "Poppins";
  font-weight: bold;
  background-color: #565656;
  text-decoration: none;
  color: white;
  border: none;
  border-radius: 5px;
}
section .container .nav-button:active {
  background-color: #232323;
}
section .container .nav-button:hover {
  background-color: #3d3d3d;
}
section .container.no-gap {
  row-gap: 0.3rem;
}
section .container.fluid {
  width: min(100rem, 95vw);
}
section .container.large-gap {
  row-gap: 3rem;
}
section .container h1 {
  color: var(--text-color, black);
  font-size: 5rem;
}
section .container .lead {
  color: var(--text-color, black);
  font-size: 1.1rem;
  font-weight: 300;
  font-family: "Poppins";
}
section.circle-bottom::after {
  content: "";
  width: 100%;
  height: var(--radius, 150px);
  display: block;
  position: absolute;
  bottom: -1px;
  background: radial-gradient(100vw 100% at bottom, var(--next-color, white) 0, var(--next-color, white) 55%, transparent calc(55% + 5px), transparent);
}
section.circle-top, section.cutting-edge {
  padding-bottom: 15rem;
}
section.circle-top::after {
  content: "";
  width: 100%;
  height: var(--radius, 150px);
  display: block;
  position: absolute;
  bottom: -1px;
  background: radial-gradient(100vw 100% at top, transparent 0, transparent 55%, var(--next-color, white) calc(55% + 5px), var(--next-color, white));
}
section.cutting-edge::after {
  content: "";
  width: 100%;
  height: var(--radius, 150px);
  display: block;
  position: absolute;
  bottom: -1px;
  background: linear-gradient(to left top,var(--next-color, white) 0 ,  var(--next-color, white) 50%, transparent 50.5%, transparent);
}
